  return (
    <div className="App">
      {/* <Login/>
      <userDetails/> */}
      <BrowserRouter>
      <Navbar></Navbar>
      <Routes>
        <Route path='/add' element={<CreateUser/>}></Route>
        <Route path='/all' element={<AllUsers/>}></Route>
        {/* to send ID */}
        <Route path='/update/:id' element={<UpdateUser/>}></Route>
        <Route path='/read/:id' element={<ReadUser/>}></Route>
      </Routes>
    </BrowserRouter>
    </div>
  );
}
export default App;
